Albion Online é um MMORPG sandbox em que você escreve sua própria história, em
vez de seguir um caminho pré-determinado. Explore um vasto mundo aberto que
consiste de 5 ecossistemas únicos. Tudo o que você faz gera um impacto no mundo, já
que em Albion, a economia é conduzida pelo jogador. Cada peça de equipamento é construída por jogadores a partir dos recursos obtidos por eles. 
. O equipamento que você usa define quem você é. Ir de cavaleiro para feiticeiro é tão fácil quanto trocar a armadura e a arma, ou uma combinação das duas.
Aventure-se no mundo aberto e enfrente os habitantes e as criaturas de Albion. Saia em expedições ou entre em masmorras para enfrentar inimigos ainda mais desafiadores. 
Enfrente outros jogadores em confrontos do mundo aberto, lute pelo controle de territórios ou cidades inteiras em batalhas táticas em grupo. Relaxe descansando em sua ilha pessoal,
onde você pode construir uma casa, cultivar alimentos e criar animais. 
Junte-se à uma guilda, tudo fica mais divertido quando se trabalha em equipe. Entre hoje mesmo no mundo de Albion, e escreva sua própria história.

Lançado no último dia 6 de outubro nos Estados Unidos,  Terrifier 2 vem deixando o público mal. Literalmente! Estão circulando nas redes sociais relatos de pessoas que desmaiaram e, ainda,
 que foram parar no hospital ao ver filme de terror.
O longa conta a história de um palhaço que, após ser ressuscitado por uma entidade bizarra, retorna ao Condado de Miles.
Lá, ele tem como alvo uma adolescente e seu irmão mais novo na noite de Halloween.
"Acabei de ver Terrifier 2. Foi uma bagunça sangrenta incrível. O cara atrás de mim desmaiou e bateu na minha poltrona,
outro cara saiu porque ele não se sentiu bem, eu o ouvi dizer isso, e saindo pela porta do cinema, eu ouvi um cara vomitando forte no banheiro", escreveu outro.
"O primeiro filme na minha vida em que eu leio relatos de pessoas desmaiando e vomitando no cinema, e daí, depois de finalmente assistir, me pego pensando: 'é, eu entendo'", afirmou o internauta.

A produção independente, roteirizada e dirigida Damien Leone, conta com cenas explícitas de extrema violência.
Uma delas mostra um assassinato no qual a pessoa é cortada ao meio de forma brutal, sem filtros.
"Os espectadores que são fracos do coração, propensos a tonturas ou têm estômagos fracos são aconselhados a ter extrema cautela",
avisou o produtor do longa Steve Barton em sua conta do Twitter. "Já houve vários casos de desmaios e vômitos nos cinemas. Para aqueles que optarem por continuar, você foi avisado”, finalizou o texto.

